import styles from "../Style.module.css";

export function Detail({
  title,
  release,
  genre,
  director,
  actor,
  plot,
  imdb,
  rt,
}) {
  return (
    <div>
      <h2>{title}</h2>
      <p>Released: {release}</p>
      <p>Genre: {genre}</p>
      <p>Director: {director}</p>
      <p>Actor: {actor}</p>
      <p>Plot: {plot}</p>
      <p>IMDB: {imdb}</p>
      <p>Rotten Tomatoes: {rt}</p>
    </div>
  );
}
